import React from 'react';
import logo from './logo.svg';
import navbarLogo from './navbar-logo.png';
import './App.css';


function App() {
  return (
    <div className="Feed">
      <Navbar />
    </div>
  )
}

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <img src={navbarLogo} alt="navbar logo" height="150px" width="200px"/>
        <input type="text" placeholder="Search"></input>
        <a href="https://www.google.com" target="_blank"><img src="images/explore-icon.png"/></a>
      </div>
    )
  }
}

export default App;
